export const LoginStart = (userCredentials) => ({
    type:"LOGIN_START"
})

export const LoginSuccess = (user) => ({
    type:"LOGIN_SUCCESS",
    payload:user,
})

export const LoginFailure = (user) => ({
    type:"LOGIN_FAILURE",
})

export const LogOut = (user) => ({
    type:"LOGOUT",
})
